[{"name": "mcp__togomcp__search_pdb_entity", "input": {"db": "pdb", "query": "kinase resolution below 2.0 angstrom", "limit": 50}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pdb", "sparql_query": "PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX PDBo: <http://rdf.wwpdb.org/schema/pdbx-v50.owl#>
PREFIX dcterms: <http://purl.org/dc/terms/>

SELECT DISTINCT ?pdb_id ?title ?resolution ?r_free ?r_work
WHERE {
  ?entry rdf:type PDBo:datablock ;
         dcterms:title ?title ;
         PDBo:has_pdbx_database_statusCategory ?status ;
         PDBo:has_reflnsCategory ?reflns ;
         PDBo:has_refineCategory ?refine .

  ?status PDBo:has_pdbx_database_status ?status_details .
  ?status_details PDBo:pdbx_database_status.entry_id ?pdb_id .

  ?reflns PDBo:has_reflns ?reflns_details .
  ?reflns_details PDBo:reflns.d_resolution_high ?resolution .

  ?refine PDBo:has_refine ?refine_details .
  ?refine_details PDBo:refine.ls_R_factor_R_free ?r_free ;
                  PDBo:refine.ls_R_factor_R_work ?r_work .

  FILTER(CONTAINS(LCASE(?title), "kinase"))
  FILTER(?resolution < 2.0)
  FILTER(?r_free < 0.25)
  FILTER(?r_work < 0.22)
}
ORDER BY ?resolution
LIMIT 20"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pdb", "sparql_query": "PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
