[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?pdbId ?resolution ?method ?chains
WHERE {
  <http://purl.uniprot.org/uniprot/P38398> up:annotation ?annotation .
  ?annotation a up:Structure_Annotation ;
                rdfs:seeAlso ?pdb .
  ?pdb up:database <http://purl.uniprot.org/database/PDB> ;
       rdfs:comment ?pdbId .
  OPTIONAL { ?pdb up:resolution ?resolution }
  OPTIONAL { ?pdb up:method ?method }
  OPTIONAL { ?pdb up:chains ?chains }
}
ORDER BY ?pdbId
"}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "P38398", "limit": 5}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pdb", "sparql_query": "
PREFIX pdbx: <http://pdbj.org/schema/pdbx-v50.owl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?pdb ?title ?method ?resolution
WHERE {
  ?entity a pdbx:entity_src_genCategory ;
          pdbx:entity_src_gen.pdbx_gene_src_common_name ?protein .
  ?entity pdbx:entity_src_gen.pdbx_src_id "P38398" .
  ?entry a pdbx:datablock ;
         pdbx:has_entity_src_genCategory ?entity .
  BIND(REPLACE(STR(?entry), ".*/(\\w+)$", "$1") AS ?pdb)
  OPTIONAL {
    ?entry pdbx:has_struct_keywordsCategory ?keywords .
    ?keywords pdbx:struct_keywords.pdbx_text ?title .
  }
  OPTIONAL {
    ?entry pdbx:has_exptlCategory ?exptl .
    ?exptl pdbx:exptl.method ?method .
  }
  OPTIONAL {
    ?entry pdbx:has_reflnsCategory ?reflns .
    ?reflns pdbx:reflns.d_resolution_high ?resolution .
  }
}
LIMIT 100
"}}, {"name": "mcp__togomcp__search_pdb_entity", "input": {"db": "pdb", "query": "P38398 BRCA1", "limit": 50}}]

[{"name": "mcp__togomcp__search_pdb_entity", "input": {"db": "pdb", "query": "human p53 DNA-binding domain", "limit": 20}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pdb", "sparql_query": "PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX PDBo: <http://rdf.wwpdb.org/schema/pdbx-v50.owl#>

SELECT ?pdbid ?resolution ?method ?title
WHERE {
  VALUES ?pdbid { "2PCX" "2XWR" "2OCJ" "1UOL" "3TS8" "4QO1" }

  ?entry a PDBo:datablock ;
         PDBo:datablockName ?pdbid ;
         PDBo:has_reflnsCategory ?reflns ;
         PDBo:has_struct_keywordsCategory ?keywords .

  ?reflns PDBo:has_reflns ?reflns_data .
  ?reflns_data PDBo:reflns.d_resolution_high ?resolution .

  ?keywords PDBo:has_struct_keywords ?kw_data .
  ?kw_data PDBo:struct_keywords.pdbx_keywords ?title .

  OPTIONAL {
    ?entry PDBo:has_exptlCategory ?exptl .
    ?exptl PDBo:has_exptl ?exptl_data .
    ?exptl_data PDBo:exptl.method ?method .
  }
}
ORDER BY ?resolution"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pdb", "sparql_query": "PREFIX PDBo: <http://rdf.wwpdb.org/schema/pdbx-v50.owl#>
PREFIX pdbo: <http://rdf.wwpdb.org/schema/pdbx-v50.owl#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT ?pdbid ?resolution 
WHERE {
  ?datablock a PDBo:datablock ;
             PDBo:datablockName ?pdbid .

  FILTER (?pdbid IN ("2PCX", "2XWR", "2OCJ", "1UOL"))

  ?datablock PDBo:has_refineCategory ?refine_cat .
  ?refine_cat PDBo:has_refine ?refine .
  ?refine PDBo:refine.ls_d_res_high ?resolution .
}
ORDER BY ?resolution"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pdb", "sparql_query": "PREFIX PDBo: <http://rdf.wwpdb.org/schema/pdbx-v50.owl#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT ?property ?value
WHERE {
  <http://rdf.wwpdb.org/pdb/2PCX> ?property ?value .
  FILTER(contains(str(?property), "resolution") || contains(str(?property), "Resolution"))
}
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pdb", "sparql_query": "PREFIX PDBo: <http://rdf.wwpdb.org/schema/pdbx-v50.owl#>

SELECT ?pdbid ?res
WHERE {
  ?s PDBo:datablockName ?pdbid .
  ?s PDBo:has_refine ?refine .
  ?refine PDBo:refine.ls_d_res_high ?res .
  FILTER(?pdbid = "2PCX")
}"}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "human p53 DNA-binding domain crystal structure highest resolution", "max_results": 10}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "p53 core domain crystal structure", "max_results": 10}}, {"name": "mcp__pubmed__get_article_metadata", "input": {"pmids": ["34862374", "34224597", "29523774"]}}]
